There's nothing quite like that.  For IDEA logs you can get them from the Help menu:

![image](https://user-images.githubusercontent.com/67586/54725925-0ec6d000-4b2e-11e9-8024-26ea37cc0584.png)

@neiljaywarner: are these the logs you're after?

@neiljaywarner 

> I was looking for flutter logs generated by print statements when running a flutter app. I actually do not know if that's what vscode saves; 

The print output would appear in the logs if you ticked "Flutter Run", but if all you're interested in is the `print()` output from your app, it should appear in the `Debug Console` pane in VS Code too. 

---

@pq 

I'm often scanning issues in the Flutter repo like "hot reload isn't working" and thinking "this would be easy to diagnose if I could get a log of the Flutter Run JSON" - but they're often IntelliJ users and I don't know how to get that. Does the option you show above include things like the VM Service and Flutter Run JSON?

In case it's of interest, the VS Code command (**Dart: Capture Logs**) lets the user choose which things to log (like the JSON to Analyzer, Flutter Run, Flutter Test, Observatory, and other processes Dart Code spawns) and then just writes combined logs for them to a single temp file. It shows a notification in the corner that logs are being gathered, and once the user has repro'd their issue they click **Stop Logging** and it opens up the log file for them to copy/paste/save. It's a great way to get a short log with just the useful info for a bug (previously I'd get thousands of lines of Analyzer log just to debug a single tooltip, for example!).
